pragma solidity ^0.5.6;

// import "@klaytn/contracts/token/KIP7/KIP7.sol";
import "./libraries/Math.sol";
import "./libraries/UQ112x112.sol";
import "./PODToken.sol";
import "@klaytn/contracts/token/KIP7/KIP7.sol";
import "@klaytn/contracts/token/KIP7/KIP7Metadata.sol";
import "./interfaces/IPODCallee.sol";

contract PODPair is KIP7, KIP7Metadata, Math {
    using SafeMath for uint256;
    using UQ112x112 for uint224;

    uint256 public constant MINIMUM_LIQUIDITY = 1000; //  LP     liquidity burn     

    // address public factory;             // factory contract address
    address public token0; // token0  contract address
    address public token1; // token0  contract address

    uint112 private reserve0; // PODPair   token0 (balance )
    uint112 private reserve1; // PODPair   token1 (balance )
    uint32 private blockTimestampLast; // uses single storage slot, accessible via getReserves

    uint256 public price0CumulativeLast; //   price oracle  (public)
    uint256 public price1CumulativeLast; //   price oracle  (public)

    bool private isEntered;

    event Mint(address indexed sender, uint256 amount0, uint256 amount1);
    event Burn(
        address indexed sender,
        uint256 amount0,
        uint256 amount1,
        address to
    );
    event Swap(
        address indexed sender,
        uint256 amount0Out,
        uint256 amount1Out,
        address indexed to
    );
    event Sync(uint256 reserve0, uint256 reserve1);

    modifier nonReentrant() {
        require(!isEntered);
        isEntered = true;

        _;

        isEntered = false;
    }

    constructor() public KIP7Metadata("V2 Pair", "V2", 18) {}

    // called once by the factory at time of deployment
    function initialize(address token0_, address token1_) external {
        require(
            token0 == address(0) && token1 == address(0),
            "already initialized"
        );

        token0 = token0_;
        token1 = token1_;
    }

    /*
    (this low-level function should be called from a contract which performs important safety checks)
        - mint : LP (LP Share)  
        - burn : LP (LP Share)  

        PODPair contract   token0, token1   
         token0, token1 contract      
           > pair   : mint,  < pair : burn 

        _reserve0, _reserve1 : pair   token0, token1 ( balance  balance)
        balance0, balance1 :  token0, token1 
        amount0, amount1 :   - pair  (  amount)
    */
    function mint(address to) public returns (uint256 liquidity) {
        (uint112 reserve0_, uint112 reserve1_, ) = getReserves(); // gas savings

        uint256 balance0 = IKIP7(token0).balanceOf(address(this));
        uint256 balance1 = IKIP7(token1).balanceOf(address(this));
        uint256 amount0 = balance0.sub(reserve0_);
        uint256 amount1 = balance1.sub(reserve1_);

        //    pair  , 1 LP 1000(MINIMUM_LIQUIDITY)   burn( )
        if (totalSupply() == 0) {
            //  liquidity(LP  ) : (amount0, amount1   - MINIMUM_LIQUIDITY)
            liquidity = Math.sqrt(amount0.mul(amount1)).sub(MINIMUM_LIQUIDITY);
            // MINIMUM_LIQUIDITY  mint  0  ( ,  burn)
            //_mint(address(0), MINIMUM_LIQUIDITY); // permanently lock the first MINIMUM_LIQUIDITY tokens
        } else {
            //    ,  
            // inflation0 = totalSupply * amount0 / reserve0
            // inflation1 = totalSupply * amount1 / reserve1
            //     inflation  liquidity  ( LP )
            liquidity = Math.min(
                amount0.mul(totalSupply()) / reserve0_,
                amount1.mul(totalSupply()) / reserve1_
            );
        }
        require(liquidity > 0, "INSUFFICIENT_LIQUIDITY_MINTED");

        //     LP  
        _mint(to, liquidity);

        // pair  reserve0, reserve1, kLast update (, kLast   )
        _update(balance0, balance1, reserve0_, reserve1_);

        emit Mint(msg.sender, amount0, amount1);
    }

    //  mint   ,    liquidity     amount    .
    function burn(address to)
        public
        returns (uint256 amount0, uint256 amount1)
    {
        uint256 balance0 = IKIP7(token0).balanceOf(address(this)); // to  A   balance
        uint256 balance1 = IKIP7(token1).balanceOf(address(this)); // to  B   balance
        uint256 liquidity = balanceOf(address(this)); // to  LP   balance

        // amount =  LP liquidity (liquidity * balance) /    (totalSupply))
        amount0 = liquidity.mul(balance0) / totalSupply(); //  LP    to  LP  (to A LP  )
        amount1 = liquidity.mul(balance1) / totalSupply(); //  LP    to  LP  (to B LP  )

        require(amount0 > 0 && amount1 > 0, "INSUFFICIENT_LIQUIDITY_BURNED");

        //   amount  transfer.
        _burn(address(this), liquidity);

        _safeTransfer(token0, to, amount0); // to A   liquidity tokenA  
        _safeTransfer(token1, to, amount1); // to B   liquidity tokenB  

        // pair  reserve0, reserve1, kLast update (, kLast   )
        balance0 = IKIP7(token0).balanceOf(address(this));
        balance1 = IKIP7(token1).balanceOf(address(this));

        (uint112 reserve0_, uint112 reserve1_, ) = getReserves();
        _update(balance0, balance1, reserve0_, reserve1_);

        emit Burn(msg.sender, amount0, amount1, to);
    }

    /*
    (this low-level function should be called from a contract which performs important safety checks)
        - swap:  ERC20     (eth, klay  wrapped  ERC-20 )
                  , PODPair token0  token1      
                 swap   swap.

                reserve  pair  ,    balance pair      
                amountOut   transfer  ,

                   amountIn    , 
                 flash loan   .
    */
    function swap(
        uint256 amount0Out,
        uint256 amount1Out,
        address to,
        bytes calldata data
    ) external nonReentrant {
        require(amount0Out > 0 || amount1Out > 0, "INSUFFICIENT_OUTPUT_AMOUNT");

        (uint112 reserve0_, uint112 reserve1_, ) = getReserves();

        require(
            amount0Out < reserve0_ && amount1Out < reserve1_,
            "INSUFFICIENT_LIQUIDITY"
        );

        // in    amount  .
        if (amount0Out > 0) _safeTransfer(token0, to, amount0Out);
        if (amount1Out > 0) _safeTransfer(token1, to, amount1Out);

        // calldata  call .
        if (data.length > 0)
            IPODCallee(to).PODCall(msg.sender, amount0Out, amount1Out, data);

        // swap      balance .
        uint256 balance0 = IKIP7(token0).balanceOf(address(this));
        uint256 balance1 = IKIP7(token1).balanceOf(address(this));

        // address _token0 = token0;
        // address _token1 = token1;
        // require(to != _token0 && to != _token1, 'INVALID_TO');

        // out     balance  ,
        // pair   reserve out   balance   
        //  amountIn  .
        uint256 amount0In = balance0 > reserve0 - amount0Out
            ? balance0 - (reserve0 - amount0Out)
            : 0;
        uint256 amount1In = balance1 > reserve1 - amount1Out
            ? balance1 - (reserve1 - amount1Out)
            : 0;

        require(amount0In > 0 || amount1In > 0, "INSUFFICIENT_INPUT_AMOUNT");

        // 0.3%      
        uint256 balance0Adjusted = balance0.mul(1000).sub(amount0In.mul(3));
        uint256 balance1Adjusted = balance1.mul(1000).sub(amount1In.mul(3));

        require(
            balance0Adjusted.mul(balance1Adjusted) >=
                uint256(reserve0_).mul(reserve1_).mul(1000**2),
            "invaild K"
        );

        _update(balance0, balance1, reserve0_, reserve1_);

        emit Swap(msg.sender, amount0Out, amount1Out, to);
    }

    /*
        - sync : skim ,     imbalance    balance  
    */
    // force reserves to match balances
    function sync() public {
        (uint112 reserve0_, uint112 reserve1_, ) = getReserves();
        _update(
            IKIP7(token0).balanceOf(address(this)),
            IKIP7(token1).balanceOf(address(this)),
            reserve0_,
            reserve1_
        );
    }

    function getReserves()
        public
        view
        returns (
            uint112,
            uint112,
            uint32
        )
    {
        return (reserve0, reserve1, blockTimestampLast);
    }

    //
    //
    //
    //  PRIVATE
    //
    //
    //

    /*
        _update : update reserves and, on the first call per block, price accumulators

        1.     token0, token1     update   
           ex) reserve  balance       
        2. price oracle   ( price        )
           ex)     price0CumulativeLast         
    */
    function _update(
        uint256 balance0,
        uint256 balance1,
        uint112 _reserve0,
        uint112 _reserve1
    ) private {
        require(balance0 <= uint112(-1) && balance1 <= uint112(-1), "OVERFLOW");
        uint32 blockTimestamp = uint32(block.timestamp % 2**32);
        uint32 timeElapsed = blockTimestamp - blockTimestampLast; // overflow is desired
        if (timeElapsed > 0 && _reserve0 != 0 && _reserve1 != 0) {
            // * never overflows, and + overflow is desired
            price0CumulativeLast +=
                uint256(UQ112x112.encode(_reserve1).uqdiv(_reserve0)) *
                timeElapsed;
            price1CumulativeLast +=
                uint256(UQ112x112.encode(_reserve0).uqdiv(_reserve1)) *
                timeElapsed;
        }
        reserve0 = uint112(balance0);
        reserve1 = uint112(balance1);
        blockTimestampLast = blockTimestamp;
        emit Sync(reserve0, reserve1);
    }

    function _safeTransfer(
        address token,
        address to,
        uint256 value
    ) private {
        (bool success, bytes memory data) = token.call(
            abi.encodeWithSignature("transfer(address,uint256)", to, value)
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "TRANSFER_FAILED"
        );
    }
}
